import React, { Fragment } from "react";

/* Router */

import {
  BrowserRouter as Router,
  Switch,
  Route,
  useParams,
} from "react-router-dom";

/* Import Component and Pages */

import Menu from "./components/menu";

import THREEBOX from "./components/three";
import CARRYBOX from "./components/carrybox/carry";
import FOODBOX from "./components/foodbox/food";
import TRAYBOX from "./components/traybox/tray";
import TRAYSBOX from "./components/traybox/trays";
import SHIRTBOX from "./components/shirtbox/shirt";
import UNTITLEDBOX from "./components/untitledbox/untitled";
import UNTITLED2BOX from "./components/untitled2box/untitled2";
import THREEJSLOCKBOX from "./components/threeJSlockbox/threeJSlock";
import THREEJS2LOCKBOX from "./components/threeJSlockbox/threeJS2lock";
import THREEJS3LOCKBOX from "./components/threeJSlockbox/threeJS3lock";

let closeBox;
let openBox;
let sizeShape;
// let showShape;

const App = () => {
  /* Button */

  closeBox = (clb) => {
    // console.log("Close");
    return THREEJS3LOCKBOX.rotations1();
  };

  openBox = (opb) => {
    // console.log("Open");
    return THREEJS3LOCKBOX.rotations2();
  };

  /* Slider */

  sizeShape = (a, b, c) => {
    // console.log(`${a} ${b} ${c}`);
    return THREEJS3LOCKBOX.updateSize(a, b, c);
  };

  /* showShape */

  // showShape = () => {
  //   return THREEJS3LOCKBOX.main();
  // };

  // return (
  //   <Router>
  //     {/* {showShape()}
  //     <Menu clb={closeBox} opb={openBox} size={sizeShape} /> */}
  //     /* Routing */
  //     <Switch>
  //       <Route exact path="/" children={<THREEBOX />} />
  //       <Route exact path="/carry" children={CARRYBOX} />
  //       <Route exact path="/food" children={FOODBOX} />
  //       <Route exact path="/tray" children={TRAYBOX} />
  //       <Route exact path="/trays" children={TRAYSBOX} />
  //       <Route exact path="/shirt" children={SHIRTBOX} />
  //       <Route exact path="/untitled" children={UNTITLEDBOX} />
  //       <Route exact path="/untitled2" children={UNTITLED2BOX} />
  //       <Route exact path="/threelock" children={THREEJSLOCKBOX} />
  //       <Route exact path="/three2lock" children={THREEJS2LOCKBOX} />
  //       <Route exact path="/three3lock" children={THREEJS3LOCKBOX} /> */}
  //     </Switch>
  //   </Router>
  // );

  return (
    <Router>
      <Switch>
        <Route exact path="/:THREE" children={<Show />} />
      </Switch>
    </Router>
  );
};

const Show = () => {
  let { THREE } = useParams();
  console.log(THREE);

  switch (THREE) {
    case "carry":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {CARRYBOX.main()}
        </Fragment>
      );
    case "food":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {FOODBOX.main()}
        </Fragment>
      );
    case "tray":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {TRAYBOX.main()}
        </Fragment>
      );
    case "trays":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {TRAYSBOX.main()}
        </Fragment>
      );
    case "shirt":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {SHIRTBOX.main()}
        </Fragment>
      );
    case "untitled":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {UNTITLEDBOX.main()}
        </Fragment>
      );
    case "untitled2":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {UNTITLED2BOX.main()}
        </Fragment>
      );
    case "threelock":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {THREEJSLOCKBOX.main()}
        </Fragment>
      );
    case "three2lock":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {THREEJS2LOCKBOX.main()}
        </Fragment>
      );
    case "three3lock":
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {THREEJS3LOCKBOX.main()}
        </Fragment>
      );
    default:
      return (
        <Fragment>
          <Menu clb={closeBox} opb={openBox} size={sizeShape} />
          {THREEBOX.main()}
        </Fragment>
      );
  }
};

export default App;
